import React from "react";
import Book from "./book";

export default class BookList extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      title: this.title
    };
  }

  handleButtonClick(e) {
    let bookTitle = document.querySelector("#title").value;
    let bookAuthor = document.querySelector("#author").value;
    let bookISBN = document.querySelector("#isbn").value;
    let bookStatus = document.querySelector("#title").value;
    let newBook = new Book(bookTitle, bookAuthor, bookISBN, bookStatus);
    console.log(newBook);
  }

  //   let newBook = new Book()

  render() {
    return (
      <div className="main">
        <div className="main-headers">
          <p>Title</p>
          <p>Author</p>
          <p>ISBN</p>
          <p>READ?</p>
        </div>

        <div className="main-books"></div>

        <div className="main-inputs">
          <input type="text" placeholder="title" id="title"></input>
          <input type="text" placeholder="author" id="author"></input>
          <input type="text" placeholder="isbn" id="isbn"></input>
          <input type="checkbox" id="status"></input>
          <button id="submit-button" onClick={this.handleButtonClick}>
            ADD
          </button>
        </div>
      </div>
    );
  }
}
